+        border-radius: 50%;
+        opacity: 0;
+        transition: 0.3s;
+    }
+
+    .swiper-button-next:after,
+    .swiper-button-prev:after {
+        color: #64656a;
+        font-size: 20px;
+    }
+
+    &:hover {
+
+        .swiper-button-next,
+        .swiper-button-prev {
+            opacity: 1;
+        }
+    }
+}
+
+.contactblock {
+    padding: 50px 120px;
