+    flex-wrap: wrap;
+    margin-top: 50px;
+
+    .descr {
+        width: 100%;
+        max-width: calc(100% - 190px);
+        flex: 0 0 calc(100% - 190px);
+        padding-right: 50px;
+
+        p {
+            max-width: 520px;
+            margin: 0;
+            color: #3c3c3c;
+            font-size: 14px;
+            letter-spacing: .4px;
+        }
+    }
+
+    a.greybtn {
+        width: 100%;
+        max-width: 190px;
+        flex: 0 0 190px;
+    }
+}
+
+
+
