+    top: 30px;
+    z-index: 16;
+    height: calc(100vh - 60px);
+    transition: 0.3s;
+    transform: translateX(130%);
+
+    &.show {
+        transform: translateX(0);
+    }
+
+    .sideformscroll {
+        overflow: auto;
+        background: #ededee;
+        padding: 20px;
