+        height: 100%;
+        padding: 70px;
+
+        &::-webkit-scrollbar {
+            width: 6px;
+        }
+
+        &::-webkit-scrollbar-thumb {
+            background-color: #64656a5a;
+            border-radius: 15px;
+        }
+    }
+
+    p {
+        color: #3c3c3c;
+        font-size: 14px;
+        margin-bottom: 25px;
+    }
+
+    .inputfield {
+        margin-bottom: 20px;
+
+        input {
+            width: 100%;
+            height: 54px;
+            background: #fff;
+            border: none;
+            outline: none;
+            padding-left: 16px;
+            color: #64656a;
+            font-family: 'Loew';
+            transition: 0.3s;
+            border-bottom: 1px solid #fff;
+
+            &:focus {
+                border-bottom: 1px solid #64656a;
+            }
+        }
+
+        textarea {
+            width: 100%;
+            height: 54px;
+            background: #fff;
+            border: none;
+            outline: none;
+            padding-left: 16px;
+            color: #64656a;
+            padding-top: 10px;
+            font-family: 'Loew';
+            height: 200px;
+            transition: 0.3s;
+            border-bottom: 1px solid #fff;
+
+            &:focus {
+                border-bottom: 1px solid #64656a;
+            }
+
+            &::-webkit-scrollbar {
+                width: 6px;
+            }
+
+            &::-webkit-scrollbar-thumb {
+                background-color: #64656a5a;
+                border-radius: 15px;
+            }
+        }
+
+    }
+
+    .checkboxessect {
+        display: flex;
+        flex-wrap: wrap;
+
+        .checkblock {
+            width: 100%;
+            max-width: 50%;
+            flex: 0 0 50%;
+
+            input {
+                display: none;
+            }
+
+            label {
+                position: relative;
+                padding-left: 20px;
+                display: block;
+                font-size: 13px;
+                color: #3c3c3c;
+                margin-bottom: 10px;
+                cursor: pointer;
+
+                &::after {
+                    content: '';
+                    display: inline-block;
+                    width: 15px;
+                    height: 15px;
+                    background: #fff;
+                    position: absolute;
+                    left: 0;
+                    top: 2px;
+                }
+            }
+        }
+    }
+
+    .greybtn {
+        max-width: 100%;
+        width: 100%;
+        height: 54px;
+    }
+
+    .closeform {
+        position: absolute;
+        top: 0;
+        left: -35px;
+        cursor: pointer;
+        width: 24px;
+        height: 24px;
+
+        img {
+            width: 100%;
+        }
+    }
+}
+
+
+
+
+
+
+@media(max-width:1600.8px) {
+    .officessection .sectiontitle {
+        margin-top: 40px;
+    }
+
+    .officessection {
+        padding: 20px 0 60px;
+    }
+
+    .contactblock {
+        padding: 50px 60px;
+    }
+}
+
+
+
+@media(max-width: 991.8px) {
+    .contboxes {
+        padding-left: 0;
+        padding-right: 0;
+    }
+    
+}
